import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define the XSS payload
    const xssPayload = "<script>alert('XSS Attempted')</script>";

    // Wait for the search input to be available
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Fill the search input with the XSS payload
    await page.fill('#searchInput', xssPayload);

    // Extract the value to confirm it was entered
    const inputValue = await page.inputValue('#searchInput');

    // Take a screenshot after entering the payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Wait for the search button to be available
    await page.waitForSelector('.search-btn', { timeout: 5000 });

    // Click the first search button to submit the form
    await page.locator('.search-btn').first().click();

    // Take a final screenshot after submission
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_submitted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_submitted.png'));

    return {
      success: true,
      action: "Attempted XSS via search input by injecting a script tag.",
      extractedData: {
        injectedPayload: inputValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to attempt XSS via search input.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
